INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (1, 'Om pe munte', 'om-pe-munte-1', 1, 'G                                  D\n1.Rucsacul, frontala, bocancii și-un cort\nC                                   G\nChitara și-un cântec la foc să te-ncânte\nC                                         G\nTe rog să le-ncerci să nu rămâi un viu mort, te rog\nC                 D                   G\nTe rog să devii OM PE MUNTE\n\nAcolo trăiești tot ce-ai putea să visezi\nAcolo iubirea-ți este hrană și punte\nSpre lumea mereu din care să evadezi, te rog\nTe rog să rămâi OM PE MUNTE\n\nRefren:\nC                           G\nZâmbește puțin, iubește senin\nD                               G\nFără niciun suspin și trăiește din plin\nC                               G\nFă drumul mai lin și alintă-l destin\nD                          G\nVorbește puțin și trăiește din plin\n\n2. Adună-ți în jur doar oameni ce vor păstra\nPetale-argintii de fericire mărunte\nȘi cântă cu ei când drumul te va chema, te rog\nTe rog, fii OM PE MUNTE\n\nȘi lasă-l așa cum ți-ai dori să-l găsești\nFără-ntrebări fără prea multe-amănunte\nÎnvață să-l urci, învață să-l prețuiești, te rog\nTe rog, fii OM PE MUNTE', 'https://www.tabulaturi.ro/acorduri/calendar/om-pe-munte-13261', 'Andrei Croitoriu');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (2, 'Ea mi-a dat bocancii', 'ea-mi-a-dat-bocancii-2', 1, 'G              C           G\nEa mi-a dat bocancii,\n                     D\nEa mi-a dat rucsacul,\nG              C           G\nEa m-a învățat să calc pe munte,\n              D            G\nEa mi-a arătat cum pot să-mi iau zborul\n\nRefren:\nC                G\nȘi de atunci eu merg,\nD                G\nMerg prin munți cu ea,\nC                G\nPasul ni-e ușor,\nD                G\nDrumul e poveste\n\n2. Ea mi-a dat curaj,\nEa mi-a dat putere,\nEa m-a învățat că viața-i frumoasă,\nCând ești liber sus pe creste', 'https://www.tabulaturi.ro/acorduri/calendar/ea-mi-a-dat-bocancii-12991', 'Lixon');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (3, 'Cântec între noi', 'cantec-intre-noi-3', 1, 'Em                        C\nUrcăm pe munte, pas cu pas,\nG                          D\nPe poteci de piatră, prin abur și ceață,\nEm                        C\nNe-așteaptă sus un loc frumos,\nG                          D\nUn colț de cer, un cântec printre stele\n\nRefren:\nC                G\nHai să cântăm,\nD                Em\nUn cântec între noi,\nC                G\nSus pe munte,\nD                Em\nUnde visul e mereu viu\n\n2. Focul arde-n noapte-adânc,\nChitara sună, și munții ascultă,\nNe-adunăm în cerc, cântând,\nUn cântec vechi ce nu se mai uită', 'https://www.tabulaturi.ro/acorduri/calendar/cantec-intre-noi-12958', 'stoiangmarius');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (4, 'Din dragoste de oameni și de munte', 'din-dragoste-de-oameni-si-de-munte-4', 1, 'Am                         G\nDin dragoste de oameni și de munte,\nF                          C\nAm pornit pe drumuri lungi,\nAm                         G\nCu rucsacul plin de vise multe,\nF                          E\nȘi cu pasul tot mai ușor\n\nRefren:\nF                    C\nSalvamont, Salvamont,\nG                    Am\nEști mereu acolo sus,\nF                    C\nCând natura ne cheamă,\nG                    Am\nTu ești cel dintâi ajuns\n\n2. Pe creste bate vântul rece,\nDar inima ne-ncălzește drumul,\nCu brațe deschise ne primesc\nȘi stâncile și cerul', 'https://www.tabulaturi.ro/acorduri/calendar/din-dragoste-de-oameni-si-de-munte-13364', 'Andrei Croitoriu');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (5, 'Libertate-n vârf de munți', 'libertate-n-varf-de-munti-5', 2, 'Em                    Am\nSus pe munte, vântul bate,\nC                     G\nȘi mă cheamă depărtările,\nEm                    Am\nVreau să urc pe toate crestele,\nC                     D\nSă găsesc libertatea\n\nRefren:\nG                     C\nLibertate-n vârf de munți,\nD                     Em\nUnde cerul se deschide,\nG                     C\nLibertate pentru toți,\nD                     Em\nCei ce-au curajul să viseze\n\n2. Pasul greu pe piatra rece,\nDar sufletul e plin de pace,\nCând ajungi pe creastă sus,\nTotul capătă sens', 'https://www.tabulaturi.ro/acorduri/tiberiu-andrei/libertate-n-varf-de-munti-12710', 'Tofan Gabriel');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (6, 'Schiorița', 'schiorita-6', 3, 'D                     A\nPe pârtia albă, cu schiurile-n picioare,\nG                     D\nCobor ca o pasăre-n zbor,\nD                     A\nCu vântul în față și soarele-n spate,\nG                     A          D\nMă simt cea mai fericită sub cer\n\nRefren:\nG                     D\nSchiorița, schiorița,\nA                     D\nZboară pe zăpadă,\nG                     D\nSchiorița, schiorița,\nA                     D\nIarna-i în paradă', 'https://www.tabulaturi.ro/acorduri/carmen-ciocolata/schiorita-13097', 'cantafabule');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (7, 'Popasul Țiganilor', 'popasul-tiganilor-7', 4, 'Am                    Dm\nLa popasul țiganilor, sus pe munte,\nAm                    E\nFocul arde vesel, stelele privesc,\nDm                    Am\nChitara cântă blând, cu melodii frunte,\nE                     Am\nȘi drumeții toți se odihnesc\n\nRefren:\nDm                    Am\nHai la foc, hai la cântec,\nE                     Am\nNoaptea-i lungă, drumul greu,\nDm                    Am\nDar pe munte-ntre prieteni,\nE                     Am\nTotul pare un muzeu', 'https://www.tabulaturi.ro/acorduri/varf-carpatin/popasul-tiganilor-12997', 'adipopbv');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (8, 'Balada drumetului obosit', 'balada-drumetului-obosit-8', 5, 'Am                         Em\nDrumețul obosit pe munte-a ajuns,\nF                          C\nCu picioarele grele și sufletul plin,\nAm                         Em\nDe amintiri și vise ce nu s-au mai spus,\nF                     G        Am\nDe doruri ascunse în colțul de vin\n\nRefren:\nC                      G\nHai drumeț, mai urcă-o dată,\nAm                     F\nCă pe creastă te-așteaptă zarea,\nC                      G\nHai drumeț, nu te lăsa,\nAm            F        Am\nCă merită-ntreaga cărarea', 'https://www.tabulaturi.ro/acorduri/albatros-galati/balada-drumetului-obosit-13467', 'RayB');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (9, 'Am iubit (ciupitură)', 'am-iubit-ciupitura-9', 6, 'G                     Em\nAm iubit un munte-nalt,\nC                     D\nAm iubit o vale-adâncă,\nG                     Em\nAm iubit un cer senin,\nC                     D\nȘi-o pădure deasă, lungă\n\nRefren:\nC                     G\nCiupitură, ciupitură,\nD                     Em\nDe la viață, de la drum,\nC                     G\nCiupitură, ciupitură,\nD                     G\nNu mai vreau să stau pe loc', 'https://www.tabulaturi.ro/acorduri/plus-noi/am-iubit-ciupitura-13532', 'Jav');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (10, 'Andrii Popa', 'andrii-popa-10', 7, 'Am                    Dm\nPrin codrul des, pe-un drum de munte,\nAm                    E\nAndrii Popa călărea,\nDm                    Am\nCu paloșul la brâu și-n frunte\nE                     Am\nSteaua dreptății strălucea\n\nRefren:\nDm                    Am\nAndrii Popa, haiduc viteaz,\nE                     Am\nDin Carpați coborâtor,\nDm                    Am\nLumea-ntreagă te știa,\nE                     Am\nCa pe-un mare apărător\n\n2. Cine fură de la săraci,\nAndrii Popa nu-i ierta,\nEl le dădea înapoi cu drag,\nTot ce boierii le lua', 'https://www.tabulaturi.ro/acorduri/pasarea-colibri/andri-popa-1426', 'anonim318');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (11, 'Muntele cu dor', 'muntele-cu-dor-11', 8, 'Em                    Am\nMuntele cu dor mă cheamă,\nD                     Em\nPe poteci de suflet lin,\nAm                    Em\nVreau s-ajung pe creastă-n zare,\nB7                    Em\nUnde cerul e senin\n\nRefren:\nAm                    Em\nMunte, munte, munte sfânt,\nD                     Em\nTe-am purtat mereu în gând,\nAm                    Em\nCu tine-am crescut pe lume,\nB7                    Em\nTu mi-ai fost cel mai bun prieten', 'https://www.tabulaturi.ro/acorduri/phoenix/muntele-cu-dor', 'Ecco');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (12, 'Floare de colț', 'floare-de-colt-12', 9, 'Am                    Dm\nSus pe munte, floare de colț,\nG                     C\nCrești în stâncă, frumoasă și rară,\nAm                    Dm\nNimeni nu te poate atinge,\nE                     Am\nEști regina munților, floare\n\nRefren:\nF                     C\nFloare de colț, floare de vis,\nG                     Am\nNăscută pe creste-nalte,\nF                     C\nFloare de colț, dar de suflet,\nG                     Am\nÎn inima mea rămâi mereu', '', 'muntean123');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (13, 'Cântec de munte', 'cantec-de-munte-13', 10, 'G                     C\nMerg pe poteci de munte-n sus,\nD                     G\nCu chitara pe umăr,\nC                     G\nȘi cânt un cântec nespus,\nD                     G\nDe fericire și dor\n\nRefren:\nC                     G\nCântec de munte, cântec de dor,\nD                     Em\nMelodie pe creste,\nC                     G\nCântec de munte, cântec de joc,\nD                     G\nCu chitara-mi poveste', '', 'anonim2378');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (14, 'Prin Carpați', 'prin-carpati-14', 11, 'Em                    Am\nPrin Carpați, pe drumuri vechi,\nC                     G\nUnde codrul este strajă,\nEm                    Am\nPasul meu nu-i niciodată greu,\nC                     D          Em\nCând natura-i priveliștea mea dragă\n\nRefren:\nC                     G\nPrin Carpați, prin Carpați,\nD                     Em\nMereu acasă mă simt eu,\nC                     G\nPrin Carpați, prin Carpați,\nD                     Em\nSub cerul munților mereu', '', 'sika');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (15, 'Amintire cu haiduci', 'amintire-cu-haiduci-15', 12, 'Am                    Dm\nSus pe munte la izvor,\nG                     C\nHaiducii se adunau,\nAm                    Dm\nCu paloșul și cu dor,\nE                     Am\nCântece de dor cântau\n\nAm                    Dm\nEra timpul de demult,\nG                     C\nCând prin codri răsuna,\nAm                    Dm\nUn cântec vechi de munte,\nE                     Am\nCe inima-ți încălzea\n\nRefren:\nF                     C\nHai la munte, hai la joc,\nG                     Am\nHai la hora haiducească,\nF                     C\nHai la foc, hai la noroc,\nG                     Am\nViața toată să-ți zâmbească', 'https://www.tabulaturi.ro/acorduri/valeriu-sterian/amintire-cu-haiduci-490', 'rasgeado');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (16, 'Munții nostri', 'muntii-nostri-16', 13, 'Em                    Am\nMunții noștri-s frumuseți,\nD                     G\nCu păduri de brazi stufoși,\nEm                    Am\nIzvoarele curg cristalin,\nD                     Em\nPrintre stânci și flori de colț\n\nRefren:\nAm                    Em\nMunții noștri, munții mari,\nD                     Em\nCarpații ne cheamă,\nAm                    Em\nMunții noștri, vechi gardieni,\nD                     Em\nAi sufletului de mamă\n\n2. Pe poteci de munte vechi,\nPașii noștri răsunau,\nEcoul din văi adânci,\nCântece frumoase dau', '', 'moldovan99');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (17, 'Drumuri de munte', 'drumuri-de-munte-17', 14, 'Am                         G\nDrumuri de munte, prin ceață și vânt,\nF                          C\nPas cu pas urcăm în sus,\nAm                         G\nCu visuri în minte și dor în cuvânt,\nF                          E        Am\nDrumul nostru nu-i apus\n\nRefren:\nF                     C\nDrumuri de munte, drumuri de vis,\nG                     Am\nCărări ce duc spre cer,\nF                     C\nDrumuri de munte, nu le-am deschis,\nG                     Am\nLe-am luat doar cu un mister\n\n2. Asfințitul arde pe creste de aur,\nȘi noaptea coboară blând,\nLa foc de tabără, sub cerul albastru,\nCântăm un cântec vechi pe rând', '', 'anonim130');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (18, 'Munte, codru și izvor', 'munte-codru-si-izvor-18', 15, 'G                     D\nMunte, codru și izvor,\nEm                    C\nTrei prieteni de demult,\nG                     D\nMă primesc cu mult amor,\nEm                    C\nCând mă-ntorc la ei pe munte\n\nRefren:\nC                     G\nHai la munte, hai pe creste,\nD                     Em\nUnde sufletul se-ntoarce,\nC                     G\nHai la munte, sunt poveste,\nD                     G\nDrumuri vechi și cărări proaste\n\n2. Focul arde la refugiu,\nStelele sunt mari și clare,\nȘi un cântec vechi de demult,\nSună prin văi și prin zări late', '', 'folk_lover');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (19, 'Noapte pe munte', 'noapte-pe-munte-19', 16, 'Am                    Em\nNoaptea coboară pe munte,\nF                     C\nStelele ard în văzduh,\nAm                    Em\nFocul pâlpâie și-mi spune,\nF                     G        Am\nPovești de demult, fără glas\n\nRefren:\nF                     C\nNoapte pe munte, noapte de vis,\nG                     Am\nCu luna plină-n zenit,\nF                     C\nNoapte pe munte, timp nescris,\nG                     Am\nUnde sufletul e fericit\n\n2. Codrul foșnește ușor,\nȘi un buhoc se aude-n depărtare,\nLupul urlă la senin,\nȘi eu cânt sub stele clare', 'https://www.tabulaturi.ro/acorduri/roza-vanturilor/noapte-pe-munte', 'anonime');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (20, 'Sus pe culmea muntelui', 'sus-pe-culmea-muntelui-20', 17, 'G                     C\nSus pe culmea muntelui,\nD                     G\nUnde aerul e curat,\nC                     G\nVăd pământul de departe,\nD                     G\nȘi mă simt eliberat\n\nRefren:\nEm                    C\nSus pe culme, sus pe culme,\nG                     D\nLumea pare mică jos,\nEm                    C\nSus pe culme, sus pe culme,\nG                     D          G\nTotul este grandios\n\n2. Nori de aur trec pe cer,\nVântul cântă melodii,\nSus pe munte mă simt bine,\nPrintre brazi și stânci pustii', '', 'rasgeado');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (21, 'Trec tiganii pe la munte', 'trec-tiganii-pe-la-munte-21', 18, 'Am                    Dm\nTrec țiganii pe la munte,\nE                     Am\nCu căruțe și cu cai,\nDm                    Am\nMuzica lor sună-n frunte,\nE                     Am\nParcă-i rai, parcă-i rai\n\nRefren:\nDm                    Am\nHai, hai, hai la drum,\nE                     Am\nMuntele ne cheamă,\nDm                    Am\nHai, hai, hai pe drum,\nE                     Am\nLibertatea-i mama\n\n2. Focul arde lângă pădure,\nCopiii dansează-n cerc,\nBătrânii povestesc cu dor,\nDe munți, de codri și de cer', 'https://www.tabulaturi.ro/acorduri/satra/trec-tiganii-498', 'rasgeado');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (22, 'Acasă pe munte', 'acasa-pe-munte-22', 19, 'G                     D\nAcasă pe munte, acolo mă simt bine,\nEm                    C\nUnde aerul e curat și cerul e albastru,\nG                     D\nAcasă pe munte, totul e pentru mine,\nEm                    C          G\nUn loc de vis, un colț de rai frumos\n\nRefren:\nC                     G\nAcasă, acasă, pe munte-s acasă,\nD                     Em\nCu brazi înalți și izvoare reci,\nC                     G\nAcasă, acasă, inima-mi e trează,\nD                     G\nCând munții mă primesc cu brațe moi și leci', '', 'geneu');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (23, 'Crestele munților', 'crestele-muntilor-23', 20, 'Am                    F\nPe crestele munților, sus,\nC                     G\nUnde vulturii zboară liberi,\nAm                    F\nAm ajuns și eu, nu mi-e greu,\nC                     E        Am\nCând natura mă-ntâmpină cu aripi\n\nRefren:\nF                     C\nCreste de munte, creste de vis,\nG                     Am\nUnde sufletul se-nalță,\nF                     C\nCreste de munte, paradis,\nG                     Am\nCea mai frumoasă fața\n\n2. Ceața se ridică-ncet,\nSoarele apare-n zare,\nȘi pe creste aurii,\nMunții ard în dimineață mare', '', 'guitarman');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (24, 'Potecile munților', 'potecile-muntilor-24', 21, 'Em                    C\nPe potecile munților merg,\nG                     D\nCu pașii grei și sufletul ușor,\nEm                    C\nVântul mă poartă ca un cerb,\nG                     D          Em\nPrin păduri de brad și de mister\n\nRefren:\nC                     G\nPotecile munților, mereu acasă,\nD                     Em\nUnde natura e regină,\nC                     G\nPotecile munților, viața-i frumoasă,\nD                     Em\nCu fiecare pas, o nouă mină', '', 'voltaj_fan');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (25, 'Brazi și stele', 'brazi-si-stele-25', 22, 'G                     Em\nBrazi și stele pe cer,\nC                     D\nNoaptea-i lungă pe munte,\nG                     Em\nFocul arde și eu sper,\nC                     D          G\nCă ne-om întâlni-n curând pe frunte\n\nRefren:\nC                     G\nBrazi și stele, brazi și vise,\nD                     Em\nSus pe munte, lângă cer,\nC                     G\nBrazi și stele nescrise,\nD                     G\nUn cântec vechi de ieri\n\n2. Codrul doarme sub zăpadă,\nIar noi cântăm la foc,\nCu chitara ne-ntoarce-n grădina,\nDe vise, de munte și de joc', '', 'd5fan');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (26, 'Vulturul din Carpați', 'vulturul-din-carpati-26', 23, 'Am                    Em\nVulturul din Carpați zboară sus,\nF                     C\nPeste vârfuri și peste văi,\nAm                    Em\nAripile-i bat în vântul aspru,\nF                     E        Am\nRege al munților de totdeauna\n\nRefren:\nF                     Am\nVulture, vulture, regele cerului,\nE                     Am\nZboară liber, zboară sus,\nF                     Am\nVulture, vulture, stăpânul vântului,\nE                     Am\nPe Carpați ai fost și vei fi spus', '', 'rocker76');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (27, 'Dimineață pe munte', 'dimineata-pe-munte-27', 24, 'D                     A\nDimineață pe munte, totul e nou,\nG                     D\nRoua strălucește pe frunze,\nD                     A\nAerul rece-mi umple plămânul mereu,\nG                     A          D\nȘi natura mă-ntâmpină cu mii de minune\n\nRefren:\nG                     D\nDimineață pe munte, zi nouă,\nA                     D\nCu soarele-n zare senin,\nG                     D\nDimineață pe munte, viața-i o rouă,\nA                     D\nCe curge pe creste divin', '', 'folk_king');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (28, 'Stânci și brazi', 'stanci-si-brazi-28', 25, 'Em                    Am\nStânci și brazi pe drumul meu,\nC                     D\nMunții mă primesc cu brațe deschise,\nEm                    Am\nPasul greu, dar sufletul ușor,\nC                     D          Em\nPe poteci de munte, cu vise nescrise\n\nRefren:\nC                     G\nStânci și brazi, munți și văi,\nD                     Em\nCarpații sunt casa mea,\nC                     G\nStânci și brazi, vise de rai,\nD                     Em\nSus pe munte, libertatea mea', '', 'vitafan');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (29, 'Ecou de munte', 'ecou-de-munte-29', 26, 'Am                    Em\nEcoul se-ntoarce de pe creste,\nF                     G\nȘi mă cheamă înapoi,\nAm                    Em\nSus pe munte, unde totul crește,\nF                     G        Am\nLiber, fără niciun poi\n\nRefren:\nF                     C\nEcou de munte, ecou de glas,\nG                     Am\nCe se pierde-n depărtări,\nF                     C\nEcou de munte, ecou de pas,\nG                     Am\nPe potecile din zări', '', 'ccfan');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (30, 'Refugiu pe munte', 'refugiu-pe-munte-30', 27, 'G                     D\nRefugiu pe munte, departe de tot,\nEm                    C\nUnde grijile nu mai ajung,\nG                     D\nAici sunt eu, cu chitara-mi și-un foc,\nEm                    C          G\nȘi un cântec ce nu se mai stinge-n lung\n\nRefren:\nC                     G\nRefugiu, refugiu pe munte,\nD                     Em\nUnde lumea stă pe loc,\nC                     G\nRefugiu, refugiu pe frunte,\nD                     G\nDoar cu cerul și cu foc', '', 'NiGhTwIsHaLeX');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (31, 'Capra neagră', 'capra-neagra-31', 28, 'Am                    Dm\nCapra neagră pe creste stă,\nAm                    E\nȘi privește lumea de sus,\nDm                    Am\nVântul bate, dar ea nu pleacă,\nE                     Am\nE regină pe munte nespus\n\nRefren:\nDm                    Am\nCapra neagră, capra mea,\nE                     Am\nSus pe stâncile-nalte,\nDm                    Am\nCapra neagră, viața ta,\nE                     Am\nE mai frumoasă decât toate', '', 'ada_fan');
INSERT INTO `songs` (`id`, `title`, `slug`, `author_id`, `content`, `source_url`, `contributor`) VALUES (32, 'Viața de vagabond pe munte', 'viata-de-vagabond-pe-munte-32', 29, 'G                     C\nViața de vagabond pe munte-i frumoasă,\nD                     G\nCu cerul deasupra și pământul sub pas,\nC                     G\nCu chitara-n brațe și cu inima trează,\nD                     G\nMerg pe drumul meu, fără niciun compas\n\nRefren:\nC                     G\nVagabond pe munte, vagabond pe drum,\nD                     Em\nLibertatea-i tot ce am,\nC                     G\nVagabond pe munte, nu știu de unde-s pe lume,\nD                     G\nDar pe munte sunt acasă, și eu cam', 'https://www.tabulaturi.ro/acorduri/ursul-trubadur/viata-de-vagabond-4049', 'appcronos');
